import React from 'react';
import {Card} from 'antd';
import NewsFeed from '../News';



class NewsCard extends React.Component {
    render() {
        const styleObj = {
            fontSize: 20,
        }

        return (
            <div>
                <Card title="News Card" size="small" style={{ width: 250 }}>
                    <NewsFeed />
                </Card>
            </div>
        );
    }
}

export default NewsCard;
